import React, { Component } from 'react';


class ResultWeather extends Component{
    render(){
        return(
            <div className='result'>
                <div className="location">     Location:   <span>  Cairo </span> </div>
                <div className="temp">         Tempreture: <span>  28    </span> </div>
                <div className="humidity">     Humidity:   <span>  26    </span> </div>
                <div className="conditions">   Conditions: <span>  Haze  </span> </div>
            </div>
        )
    }
}


export default ResultWeather;
